[{"type":"$core.execJSCode","options":{"content":"context.$component.get("Detail").formValidate().then(function (valid) {
    // 当前组件
    let table = context.$page.getComponentByName("Records");

    $model.ref("Detail").save().then(data=>{
        // 成功消息
