        }
        else {
            context.$message.error('Save Failed:' + data.resMsg, 5)
        }
    }).catch(e=>{
        // 失败消息
        context.$message.error('Save Failed:' + e, 5)
    });
});"},"__nodeName":"自定义JS代码"}]

[{"type":"$core.execJSCode","options":{"content":"context.$component.get("Detail").formValidate().then(function (valid) {
    // 当前组件
    let table = context.$page.getComponentByName("Records");

    $model.ref("Detail").save().then(data=>{
        // 成功消息
        if(data.resCode == 0){
            table.doQuery();
            // 关闭弹框
            $model.ref("showModal").setData(false);
            // 重置字段取值
            setTimeout(function () {
                context.$component.get("Detail").resetFields();
            });
            // 提交审批
            context.$approval(data.result[0].id).then(res=>{
                if(res.resCode == 0) {
                    context.$message.success('Save Successfully.');
                }
                else if(res.resCode == "405230808") {
                $model.ref("showUserModal").setData(true);
                $model.ref("recordId").setData(data.result[0].id);
                }
                else{
                    context.$message.error('Submit Approval Failed:' + res.resMsg, 5)
                }
            })
        }
        else {
            context.$message.error('Save Failed:' + data.resMsg, 5)
        }
    }).catch(e=>{
        // 失败消息
        context.$message.error('Save Failed:' + e, 5)
    });
});
"},"__nodeName":"自定义JS代码"}]

